cli:
  baseCommand: [camelyon-utils, slide-tiles]
  class: CommandLineTool
  cwlVersion: v1.0
  doc: CAMELYON Utils is a set of tools to process slides of the CAMELYON image database.
  inputs:
    mask:
      doc: Path to MASKFILE in CAMELYON XML format.
      inputBinding: {prefix: --mask}
      type: File?
    second_scanner:
      doc: Slides of the second scanner have different zoom levels, which will be
        set if this parameter is true.
      inputBinding: {prefix: --second-scanner}
      type: boolean?
    slide:
      doc: Path to SLIDEFILE in  OpenSlide tif format.
      inputBinding: {position: 0}
      type: File
  outputs:
    tiles:
      doc: HDF5 file containing tiles as numpy arrays generated from slide.
      outputBinding: {glob: tiles.hdf5}
      type: File
container:
  engine: docker
  settings:
    image: {url: 'docker.io/deepprojects/camelyon-utils:0.2.1'}
    ram: 8192
execution:
  engine: ccagency
  settings:
    access:
      auth: {password: '{{agency_password}}', username: '{{agency_username}}'}
      url: https://agency.f4.htw-berlin.de/cc
    batchConcurrencyLimit: 16
    retryIfFailed: true
redVersion: '7'
